<?php

namespace W4Y\Bundle\SandboxBundle\Controller;

use Symfony\Bundle\FrameworkBundle\Controller\Controller;
use Symfony\Component\HttpFoundation\Response;
use Symfony\Component\HttpFoundation\Request;

class DefaultController extends Controller
{
    public function indexAction()
    {
        return $this->render('W4YSandboxBundle:Default:index.html.twig');
    }

    public function jsonCarDataAction(Request $request)
    {
        /** @var \Symfony\Component\HttpFoundation\Session\Session $session */
        $session = $this->container->get('session');
        $sessionKey = 'carData';

        // p$session->remove($sessionKey);

        $carData = $session->get($sessionKey);
        if (empty($carData)) {
            $carData = $this->getData();
            $session->set($sessionKey, $carData);
        }

        $offset = (int) $request->query->get('offset', 0);
        $limit = (int) $request->query->get('limit', 16);

        $data = array_slice($carData, $offset, $limit);

        // Sleep so we can simulate that the pre-loading of data is really working.
        if (0 !== $offset) {
            sleep(1);
        }

        return new Response(json_encode($data));
    }

    private function getData()
    {
        $images = [
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
        ];

        $randomImages =  count($images);

        $data = [];
        for ($i = 0; $i < 500; $i++) {
            $d = [
                'id' => $i + 1,
                'name' => 'Name',
                'image' => $images[rand(0, ($randomImages - 1))]
            ];

            $data[] = $d;
        };

        return $data;
    }


}
